import { Row, Col } from 'antd';


export class Review extends Component {
    render() {
        return (
            <div style={{margin:"50px"}}>
    <Row>
      <Col span={24}>Meal</Col>
      <Col span={24}>No. of People</Col>
      <Col span={24}>Restaurant</Col>
      <Col span={24}>Dishes</Col>
    </Row>




            </div>
        )
    }
}

export default Review
